/*
Filesystem
 */
window.requestFileSystem  = window.requestFileSystem || window.webkitRequestFileSystem;
window.resolveLocalFileSystemURL = window.resolveLocalFileSystemURL || window.webkitResolveLocalFileSystemURL;


if (navigator.webkitPersistentStorage) { //When running on PhantomJS (for unittesting) we don't have a filesystem
    console.log("requesting Quota");
    navigator.webkitPersistentStorage.requestQuota(5*1024*1024, function(grantedBytes) {
        console.log("grantedBytes: " + grantedBytes);
        console.log("requesting FS");
        window.requestFileSystem(window.PERSISTENT, grantedBytes, function(fs) {
            cordova.file.externalDataDirectory = fs.root.toURL();
            cordova.file.externalApplicationStorageDirectory = fs.root.toURL();
        }, function() {
            console.log("FS error", arguments);
        });
    }, function(e) {
        console.log('Error', e);
    });
}


Camera = {
    DestinationType: {
        FILE_URI: "FILE_URI"
    },
    PictureSourceType: {
        CAMERA: "CAMERA"
    },
    EncodingType: {
        JPEG: "JPEG"
    }
}
navigator = navigator || {};

navigator.camera = {};

navigator.camera.getPicture = function getPicture(success, error, options) {
    options = options || {targetWidth: 1280, targetHeight: 720 };

    var streaming = false,
        video = window.video = document.createElement('video'),
        canvas = document.createElement('canvas'),
        width = options.targetWidth || 1280,
        height = options.targetWidth || 720,
        openStream = null;

    navigator.getMedia = ( navigator.getUserMedia ||
    navigator.webkitGetUserMedia ||
    navigator.mozGetUserMedia ||
    navigator.msGetUserMedia);

    canvas.width = width;
    canvas.height = height;

    video.addEventListener('canplay', function (ev) {
        if (!streaming) {
            height = video.videoHeight / (video.videoWidth / width);
            video.setAttribute('width', width);
            video.setAttribute('height', height);
            canvas.setAttribute('width', width);
            canvas.setAttribute('height', height);
            streaming = true;
        }
    }, false);

    navigator.getMedia({ video: true, audio: false }, function (stream) {
            openStream = stream;
            var vendorURL = window.URL || window.webkitURL;
            video.src = vendorURL.createObjectURL(stream);
            video.play();
            setTimeout(function () {
                canvas.getContext('2d').drawImage(video, 0, 0, width, height);
                var data = canvas.toDataURL('image/jpg');
                //data = data.split(",")[1];

                //openStream.stop(); //stop on stream is deprecated

                //Get all the tracks & stop them
                openStream.getAudioTracks().forEach(function(track) {
                    track.stop();
                });
                openStream.getVideoTracks().forEach(function(track) {
                    track.stop();
                });

                if (options.destinationType === Camera.DestinationType.FILE_URI) {
                    saveToFile(data, success, error);
                } else if (options.destinationType === Camera.DestinationType.DATA_URL) {
                    //the Cordova camera plugins return a dataUrl without any meta-information, we need to strip the meta-information (and it will be added later, how is that for efficiency! :)
                    var index = data.indexOf(",");
                    data = data.substring(index + 1);
                    success(data);
                } else {
                    error("unknown destinationType");
                }

            }, 1000); //note: the timeout is important. If the timeout is too low you will get an invalid photo
        },
        function (err) {
            alert("Media error, make sure a webcam is available");
            error(err);
        }
    );

    function saveToFile(data, success, error) {
        var blob = dataURItoBlob(data);
        console.log("blob: " + blob, blob);

        var writeFileErrorHandler = function(err) {

        }

        console.log("resolveLocalFileSystemURL for: " + cordova.file.externalDataDirectory);
        window.resolveLocalFileSystemURL(cordova.file.externalDataDirectory, function (fileSystem) {
            console.log("got fileSystem: " + fileSystem, fileSystem);

            var filename = (new Date()).getTime() + ".png";

            fileSystem.getFile(filename, {create: true, exclusive: true}, function(fileEntry) {
                console.log("got fileEntry: " + fileEntry, fileEntry);

                fileEntry.createWriter(function(fileWriter) {
                    console.log("got fileWriter: " + fileWriter, fileWriter);

                    fileWriter.onwriteend = function(e) {
                        console.log('Write completed.');
                        success(fileEntry.toURL());
                    };

                    fileWriter.onerror = function(e) {
                        error('Write failed: ' + e.toString())
                    };

                    fileWriter.write(blob);

                }, error);


            }, error);

        }, error)
    }

}

